import "./navbar.scss";
import HomeOutlinedIcon from "@mui/icons-material/HomeOutlined";
import DarkModeOutlinedIcon from "@mui/icons-material/DarkModeOutlined";
import WbSunnyOutlinedIcon from "@mui/icons-material/WbSunnyOutlined";
import SearchOutlinedIcon from "@mui/icons-material/SearchOutlined";
import { Link } from "react-router-dom";
import { useContext, useEffect, useState } from "react";
import { DarkModeContext } from "../../context/darkModeContext";
import { AuthContext } from "../../context/authContext";

const Navbar = () => {
  const { toggle, darkMode } = useContext(DarkModeContext);
  const { currentUser } = useContext(AuthContext);
  
  const [homeIconColor, setHomeIconColor] = useState(() => {
    return localStorage.getItem("homeIconColor") || "greenDark";
  })

  const handleHomeIconClick = () => {
    setHomeIconColor((prevColor) =>
    prevColor === "greenDark" ? "limeGreen" : "greenDark"
  );

  };

  useEffect(() => {
    localStorage.setItem("homeIconColor", homeIconColor);
  }, [homeIconColor]);


  return (
    <div className="navbar">
      <div className="left">
          <span>Uni4Life</span>
        <Link to="/" style={{ textDecoration: "none" }}>
        <HomeOutlinedIcon 
          	style={{ color: homeIconColor }}
            onClick={handleHomeIconClick} 
          />
        </Link>
        <div className="search">
          <SearchOutlinedIcon />
          <input type="text" placeholder="Search..." />
        </div>
      </div>
      <div className="right">
      {darkMode ? (
          <WbSunnyOutlinedIcon onClick={toggle} />
        ) : (
          <DarkModeOutlinedIcon onClick={toggle} />
        )}
      </div>
    </div>
  );
};

export default Navbar;
